import { Injectable } from '@angular/core';

@Injectable()
export class AuthorizeService {
  private isAuthenticated = false;
  constructor() {}

  // check authorization
  getIsAuth(): boolean {
    return this.isAuthenticated;
  }

  // login
  login(): boolean {
    return (this.isAuthenticated = true);
  }
}
